export const getAuth = async (dni, phone) => {
  const result = await fetch("http://localhost:5000/datings", {
    method: "GET",
    headers: {
      dni: dni,
      phone: phone,
    },
  });
  console.log(dni, phone, "parameters of getAuth");
  return result;
};
